    $("area[data-tooltip]").on("mouseover", function(eventObject) {

        idLocation = $(this).attr("id").substring(5);
        $("#tooltip").hide();
        $("#tooltip").attr('location', idLocation);
        $data_tooltip = $(this).attr("data-tooltip");
        var toplocation = parseInt($('.'+idLocation).offset().top);
        var leftlocation = parseInt($('.'+idLocation).offset().left);


        switch (idLocation) {
          case 'hospital':
            toplocation-=80;
          break;
          case 'radiostation':
            toplocation+=120;
          break;
          case 'tv-tower':
            toplocation+=320;
          break;
          case 'businescenter':
            toplocation+=180;
            leftlocation-=55;
