          break;
          case 'whitehouse':
            toplocation-=80;
            leftlocation+=55;
          break;
          case 'restaurant':
            toplocation-=80;
            leftlocation+=75;
          break;
          case 'academy':
            toplocation-=80;
            leftlocation+=55;
          break;
          case 'store':
            toplocation-=80;
            leftlocation+=15;
          break;

          default:
            toplocation-=80;
        }

        $("#tooltip").attr('location', idLocation);

        $("#tooltip").find('h2').text($data_tooltip);

        $("#tooltip")
          .css({ 
            "top" : toplocation,
            "left" : leftlocation
        }).show();

